INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24001, 2, 0.0, 102301, "2030/12/17 14:59:59", 24, "アヤネ", 0.0, 401, 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24002, 2, 0.0, 102301, "2030/12/17 14:59:59", 24, "アヤネ", 0.0, 402, 1, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2020/07/31 12:00:00", 2.21);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24003, 2, 0.0, 102301, "2030/12/17 14:59:59", 24, "アヤネ", 0.0, 403, 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24004, 1, 0.0, 192201, "2030/12/17 14:59:59", 24, "アサヒ", 0.0, 701, 2, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2020/07/31 12:00:00", 1.99);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24005, 2, 0.0, 192201, "2030/12/17 14:59:59", 24, "アサヒ", 0.0, 702, 1, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2020/07/31 12:00:00", 2.21);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24006, 1, 0.0, 192201, "2030/12/17 14:59:59", 24, "アサヒ", 0.0, 703, 2, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2020/07/31 12:00:00", 3.33);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24007, 2, 0.0, 192301, "2030/12/17 14:59:59", 24, "部員３", 0.0, 801, 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24008, 2, 0.0, 192301, "2030/12/17 14:59:59", 24, "部員３", 0.0, 802, 1, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2020/07/31 12:00:00", 2.68);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24009, 2, 0.0, 192301, "2030/12/17 14:59:59", 24, "部員３", 0.0, 803, 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24010, 1, 0.0, 192501, "2030/12/17 14:59:59", 24, "", 0.0, 501, 1, "やった！", "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24011, 1, 0.0, 192501, "2030/12/17 14:59:59", 24, "", 0.0, 502, 1, "勝ったよ！", "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24012, 1, 0.0, 192501, "2030/12/17 14:59:59", 24, "", 0.0, 503, 1, "いい調子！", "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24013, 2, 0.0, 113501, "2030/12/17 14:59:59", 24, "ミサト", 0.0, 111, 6, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2020/07/31 12:00:00", 5.33);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24014, 2, 0.0, 113501, "2030/12/17 14:59:59", 24, "ミサト", 0.0, 112, 1, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2020/07/31 12:00:00", 6.85);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24015, 2, 0.0, 113501, "2030/12/17 14:59:59", 24, "ミサト", 0.0, 113, 1, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2020/07/31 12:00:00", 3.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24016, 2, 0.0, 192401, "2030/12/17 14:59:59", 24, "ダイチ", 0.0, 611, 1, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2020/07/31 12:00:00", 6.11);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24017, 2, 0.0, 192401, "2030/12/17 14:59:59", 24, "ダイチ", 0.0, 612, 1, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2020/07/31 12:00:00", 6.75);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24018, 2, 0.0, 192401, "2030/12/17 14:59:59", 24, "ダイチ", 0.0, 613, 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24019, 1, 0.0, 113401, "2030/12/17 14:59:59", 24, "ハツネ", 0.0, 211, 2, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2020/07/31 12:00:00", 4.52);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24020, 1, 0.0, 113401, "2030/12/17 14:59:59", 24, "ハツネ", 0.0, 212, 2, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2020/07/31 12:00:00", 3.89);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24021, 2, 0.0, 113401, "2030/12/17 14:59:59", 24, "ハツネ", 0.0, 213, 1, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2020/07/31 12:00:00", 13.49);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24022, 2, 0.0, 106501, "2030/12/17 14:59:59", 24, "カヤ", 0.0, 311, 1, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2020/07/31 12:00:00", 3.17);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24023, 2, 0.0, 106501, "2030/12/17 14:59:59", 24, "カヤ", 0.0, 312, 1, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2020/07/31 12:00:00", 4.42);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24024, 1, 0.0, 106501, "2030/12/17 14:59:59", 24, "カヤ", 0.0, 313, 6, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2020/07/31 12:00:00", 2.89);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24025, 3, 0.0, 102301, "2030/12/17 14:59:59", 24, "アヤネ", 0.0, 421, 4, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2020/07/31 12:00:00", 3.71);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24026, 1, 0.0, 192201, "2030/12/17 14:59:59", 24, "アサヒ", 0.0, 721, 2, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2020/07/31 12:00:00", 5.1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24027, 3, 0.0, 192301, "2030/12/17 14:59:59", 24, "部員３", 0.0, 821, 1, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2020/07/31 12:00:00", 4.34);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24028, 1, 0.0, 192501, "2030/12/17 14:59:59", 24, "", 0.0, 521, 1, "いい勝負だったよ\nまたやろうね", "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24029, 2, -360.0, 113501, "2030/12/17 14:59:59", 24, "ミサト", 0.0, 101, 1, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2020/07/31 12:00:00", 5.62);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24030, 2, -360.0, 113501, "2030/12/17 14:59:59", 24, "ミサト", 0.0, 102, 1, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2020/07/31 12:00:00", 9.58);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24031, 2, -360.0, 113501, "2030/12/17 14:59:59", 24, "ミサト", 0.0, 103, 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24032, 1, -360.0, 113501, "2030/12/17 14:59:59", 24, "ミサト", 0.0, 104, 2, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2020/07/31 12:00:00", 9.13);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, 24033, 2, -360.0, 113501, "2030/12/17 14:59:59", 24, "ミサト", 0.0, 105, 1, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2020/07/31 12:00:00", 8.27);
